import logo from "../images/logo.png";
import Navbar from "./navbar";
const Header = () => {
  return (
    <header>
      <nav className="nav">
        <img src={logo} alt="logo" />
        <a href="#">
          <button className="btn-primary">Launch App</button>
        </a>
      </nav>
    </header>
  );
};

export default Header;
